import '../css/bar_css.scss';
import logo from'../img/logo.png'

class Bar extends React.Component{
    render(){
        return(
            <div className="bar">
                <img src={logo} alt=""/>
                <div className="content_bar">
                    <a href="" className='inicio'>Inicio</a>
                    <input className='boton_input' type="text"/>
                </div>
            </div>
        )
    }
}
export default Bar;
